import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const [members, setMembers] = useState([]);
  const [events, setEvents] = useState([]);
  const [gallery, setGallery] = useState([]);
  const [news, setNews] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    // Check authentication
    const isAuthenticated = localStorage.getItem('adminAuthenticated');
    if (!isAuthenticated) {
      navigate('/admin');
    }
    // Load data (in a real application, this would fetch from an API)
    loadData();
  }, [navigate]);

  const loadData = () => {
    // In a real application, these would be API calls
    // For now, we'll use mock data
    setMembers(JSON.parse(localStorage.getItem('members') || '[]'));
    setEvents(JSON.parse(localStorage.getItem('events') || '[]'));
    setGallery(JSON.parse(localStorage.getItem('gallery') || '[]'));
    setNews(JSON.parse(localStorage.getItem('news') || '[]'));
  };

  const handleLogout = () => {
    localStorage.removeItem('adminAuthenticated');
    navigate('/admin');
  };

  return (
    <div className="admin-dashboard">
      <header className="dashboard-header">
        <h1>Admin Dashboard</h1>
        <button onClick={handleLogout} className="logout-btn">Logout</button>
      </header>

      <main className="dashboard-content">
        <div className="dashboard-stats">
          <div className="stat-card">
            <h3>Total Members</h3>
            <p>{members.length}</p>
          </div>
          <div className="stat-card">
            <h3>Total Events</h3>
            <p>{events.length}</p>
          </div>
          <div className="stat-card">
            <h3>Gallery Images</h3>
            <p>{gallery.length}</p>
          </div>
          <div className="stat-card">
            <h3>News Articles</h3>
            <p>{news.length}</p>
          </div>
        </div>

        <div className="dashboard-overview">
          <div className="overview-section">
            <h2>Recent Members</h2>
            <div className="members-list">
              {members.slice(0, 5).map(member => (
                <div key={member.id} className="member-card">
                  <h3>{member.surname}, {member.name}</h3>
                  <p>Phone: {member.phone}</p>
                  <p>Email: {member.email}</p>
                </div>
              ))}
            </div>
          </div>

          <div className="overview-section">
            <h2>Upcoming Events</h2>
            <div className="events-list">
              {events.slice(0, 5).map(event => (
                <div key={event.id} className="event-card">
                  <h3>{event.title}</h3>
                  <p>Date: {new Date(event.date).toLocaleDateString()}</p>
                  <p>Location: {event.location}</p>
                </div>
              ))}
            </div>
          </div>

          <div className="overview-section">
            <h2>Latest News</h2>
            <div className="news-list">
              {news.slice(0, 5).map(article => (
                <div key={article.id} className="news-card">
                  <h3>{article.title}</h3>
                  <p>Date: {new Date(article.date).toLocaleDateString()}</p>
                  <p>{article.content.substring(0, 100)}...</p>
                </div>
              ))}
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default AdminDashboard;
